import numpy as np
import scipy.stats as st
from pomdp_py.problems.motion_planning.test_utils.test import get_mean_std_ci

def get_mean_std_ciw(data, confidence=0.95):
    mean = np.mean(data)
    std = np.std(data)
    ci = st.t.interval(alpha=0.95, df=len(data) - 1, loc=np.mean(data), scale=st.sem(data))
    ciw = mean - ci[0]

    return mean, ciw, std, ci

